import React, { Component } from 'react';

class HeaderWrapper extends Component {
  render() {
    return (
      <div id="header-wrapper">
        <div id="header">
          <div id="logo">
            <h1><a href="#">茶包</a></h1>
          </div>
        </div>
      </div>
    );
  }
}




export default App;
